message:
Nas portas dos quartéis até a instalação da GLO.

Passos das ações do PR para a GLO:

1) Faxina com base no Art. 142; 

2) Declaração de guerra com base no Art. 8419; 

3) Requerimento de aprovação do estado de sítio ao Congresso.

